{'videoId': '_m7GSNQao0s', 'topLevelComment': {'kind': 'youtube#comment', 'etag': 'mEqZY8A2ct0mM7ighyvgJKh2NNc', 'id': 'Ugx8U3sVGkDBEc7KIzh4AaABAg', 'snippet': {'videoId': '_m7GSNQao0s', 'textDisplay': 'O Bolsonaro é um tosco, com toda certeza, contudo, vocês não ficam para trás, pois, acabam agindo de modo &#39;intelectualmente desonestos&#39; quando usam a expressão &#39;pastores&#39; como quem faz uma generalização absurda, dando a entender que todos os pastores agem desse modo. E, estes líderes religiosos famosos e oportunistas, que aparecem, muitas vezes nem são reconhecidos por pastores protestantes (reforma protestante) como pastores, mas sim, líderes de seitas. Caso de Valdomiros, Macedos e congêneres.<br><br>Quanto a religiosos não poderem estar em espaços públicos com suas roupas características, isso se chama &#39;intolerância religiosa&#39;, sem dúvidas. Isso é querer que a pessoa seja despida de parte de sua personalidade em prol de uma intolerância de quem se incomoda. Logo também vão proibir a baiana do acarajé de entrar num espaço público sem sua burca e vestido branco e não só os cristãos, mas duvido que façam o mesmo com mulçumanos. <br><br>Quanto a atacar pessoas criando fatos falsos (como no caso da invenção contra o Nicolas, que foi desmentido pelo próprio ator do filme) e achar que ele buscar a via judicial não é um ato democrático, chega a soar autoritário. Acham que buscar a via judicial não faz parte da democracia. E a Maria do Rosário que nem buscou o judiciário, enviou foi uma carta com selo do Estado ao Danilo Gentili. O que vocês não entendem é que a esquerda está sofrendo isso agora, porque abusaram de usar essas ferramentas no passado, e os oponentes passaram a fazer o mesmo. Havia um discurso bonitinho, mas a postura, não. Fala que buscar o judiciário não deveria existir na democracia, porém, o jornalista (William Larry Rohter Junior, correspondente no Rio de Janeiro do jornal The New York Times) que o Lula tentou expulsar do Brasil não teria conseguido aqui ficar se não fosse uma liminar do judiciário.', 'textOriginal': "O Bolsonaro é um tosco, com toda certeza, contudo, vocês não ficam para trás, pois, acabam agindo de modo 'intelectualmente desonestos' quando usam a expressão 'pastores' como quem faz uma generalização absurda, dando a entender que todos os pastores agem desse modo. E, estes líderes religiosos famosos e oportunistas, que aparecem, muitas vezes nem são reconhecidos por pastores protestantes (reforma protestante) como pastores, mas sim, líderes de seitas. Caso de Valdomiros, Macedos e congêneres.

Quanto a religiosos não poderem estar em espaços públicos com suas roupas características, isso se chama 'intolerância religiosa', sem dúvidas. Isso é querer que a pessoa seja despida de parte de sua personalidade em prol de uma intolerância de quem se incomoda. Logo também vão proibir a baiana do acarajé de entrar num espaço público sem sua burca e vestido branco e não só os cristãos, mas duvido que façam o mesmo com mulçumanos. 

Quanto a atacar pessoas criando fatos falsos (como no caso da invenção contra o Nicolas, que foi desmentido pelo próprio ator do filme) e achar que ele buscar a via judicial não é um ato democrático, chega a soar autoritário. Acham que buscar a via judicial não faz parte da democracia. E a Maria do Rosário que nem buscou o judiciário, enviou foi uma carta com selo do Estado ao Danilo Gentili. O que vocês não entendem é que a esquerda está sofrendo isso agora, porque abusaram de usar essas ferramentas no passado, e os oponentes passaram a fazer o mesmo. Havia um discurso bonitinho, mas a postura, não. Fala que buscar o judiciário não deveria existir na democracia, porém, o jornalista (William Larry Rohter Junior, correspondente no Rio de Janeiro do jornal The New York Times) que o Lula tentou expulsar do Brasil não teria conseguido aqui ficar se não fosse uma liminar do judiciário.", 'authorDisplayName': '𝗜𝗡𝗩𝗘𝗦𝗧𝗜𝗗𝗢𝗟𝗢𝗚𝗜𝗔', 'authorProfileImageUrl': 'https://yt3.ggpht.com/dKzUl2cFvFouzZ_p2gN8A127an1VbdTbbPwbKP3JpLuZt_iNLDtpXpwFOVTrPOCkmARjkOY_ew=s48-c-k-c0x00ffffff-no-rj', 'authorChannelUrl': 'http://www.youtube.com/channel/UCkZL5foLuheZE9s17iNkmSA', 'authorChannelId': {'value': 'UCkZL5foLuheZE9s17iNkmSA'}, 'canRate': True, 'viewerRating': 'none', 'likeCount': 0, 'publishedAt': '2022-10-16T03:37:36Z', 'updatedAt': '2022-10-16T03:39:30Z'}}, 'canReply': True, 'totalReplyCount': 0, 'isPublic': True}
